function precache(){return caches.open(CACHE).then(function(n){return n.addAll(["./index.html","./style.min.css","./main.min.js","./assets/img/favicon.ico","./assets/font/Roboto.min.css","./assets/font/RobotoThin.woff2"])})}function fromCache(n){return caches.open(CACHE).then(function(t){return t.match(n).then(function(n){return n||Promise.reject("no-match")})})}function update(n){return caches.open(CACHE).then(function(t){return fetch(n).then(function(e){return t.put(n,e)})})}var CACHE="cache-and-update";self.addEventListener("install",function(n){n.waitUntil(precache())}),self.addEventListener("fetch",function(n){n.respondWith(fromCache(n.request)),n.waitUntil(update(n.request))});
